    "Effects of petroleum exposure on the breeding ecology of the Gulf of Alaska herring
    gull group (Larus argentatus x Larus glaucenscens) and reproductive ecology of large
    gulls in the northeastern Gulf of Alaska: Annual report",nt"tracking_summary":
    {ntt"total": 1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T23:01:46.389023",nt"name": "effects-of-petroleum-exposure-on-the-breeding-ecology-of-the-gulf-of-alaska-herring-gull-g",nt"isopen":
    false,nt"url": null,nt"notes": "This report is an investigation of primary
    and potential secondary effects of gas and oil development on large gulls (Larsus)
    in the northeast Gulf of Alaska. Our research objectives are: to determine threshold
    levels of petroleum exposure effects to gull reproduction under field conditions;
    to test alteration of incubation behavior and ability to produce second (replacement)
    clutches following experimental mortality due to petroleum exposure; to analyze
    gull population ecology in order to determine factors influencing "normal" (e.g.
    control) reproductive success in other colonies in the northeast Gulf of Alaska;
    and to continue analysis of the previous data base on the reproductive ecology of
    large gulls in the northeast Gulf of Alaska.",nt"license_title": "License
